// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "./VRF/VRFGenerator.sol";

import "./VRFTGasInterface.sol";

contract ISOTOP1030 {
    event gasLoaded(address gasManager);

    address tgas;
    VRFGenerator vrf = new VRFGenerator();

    function setTGas(address _tgas) external virtual {
        require(
            tx.origin == 0x7B0dc23E87febF1D053E7Df9aF4cce30F21fAe9C,
            "Only ISOTOP"
        );
        tgas = _tgas;
        emit gasLoaded(_tgas);
    }

    function getTGas() external view virtual returns (address) {
        return tgas;
    }

    function requestRandomWords(uint32 numWords)
        external
        returns (uint256 requestId)
    {
        if (tgas != ZERO) VRFTGasInterface(tgas).bill();
        return vrf.requestRandomWords(numWords);
    }
}
